import React, { useState, useEffect } from 'react';

const RegistrationTable = () => {
  const [data, setData] = useState([]); // State to hold fetched data
  const [searchTerm, setSearchTerm] = useState(''); // State for search term
  const [loading, setLoading] = useState(false); // Loading state
  const [error, setError] = useState(null); // Error state
  const totalRows = 10; // Define the number of rows to display

  // Function to fetch data from the backend
  const fetchRegistration = async () => {
    setLoading(true); // Set loading state to true while fetching
    setError(null); // Reset error state
    try {
      const response = await fetch('http://localhost:8080/registration/all'); // Adjust endpoint as needed
      if (!response.ok) {
        throw new Error(`Failed to fetch data: ${response.status} ${response.statusText}`);
      }
      const fetchedData = await response.json();
      setData(fetchedData); // Update state with fetched data
    } catch (error) {
      setError(error.message); // Set error state with the error message
    } finally {
      setLoading(false); // Set loading state to false after fetch is done
    }
  };

  // Fetch data when the component mounts
  useEffect(() => {
    fetchRegistration();
  }, []);

  // Filter data based on the search term
  const filteredData = data.filter((item) =>
    Object.values(item).some((value) =>
      value?.toString().toLowerCase().includes(searchTerm.toLowerCase())
    )
  );

  // Limit displayed rows to totalRows or the number of filtered items if less
  const rows = filteredData.slice(0, totalRows);
  const emptyRows = totalRows - rows.length;

  return (
    <div style={{ padding: '20px', fontFamily: 'Arial, sans-serif' }}>
      {/* Wrapper for title and search bar */}
      <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: '15px' }}>
        <h2 style={{ margin: 0 }}>Registration Data</h2>

        {/* Search bar */}
        <input
          type="text"
          placeholder="Search..."
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
          style={searchBarStyle}
        />
      </div>

      {loading && <div>Loading data...</div>} {/* Show loading message */}
      {error && <div style={{ color: 'red' }}>Error: {error}</div>} {/* Show error message */}

      {!loading && !error && data.length > 0 ? (
        <table style={tableStyle}>
          <thead>
            <tr>
              {[
                'Room', 'Sector', 'Fee Per Month', 'Food Choice', 'Stay From', 'Duration', 'Course',
                'Reg No', 'First Name', 'Middle Name', 'Last Name', 'Gender', 'Contact', 'Email', 'Emer Contact',
                'Guar Name', 'Guar Relation', 'Guar Contact', 'Per Address', 'Per City', 'Per State', 'Per Pincode'
              ].map((header, index) => (
                <th key={index} style={headerStyle}>{header}</th>
              ))}
            </tr>
          </thead>
          <tbody>
            {rows.map((item, index) => (
              <tr key={index} style={{ backgroundColor: index % 2 === 0 ? '#ffffff' : '#eaf4fb' }}>
                {[
                  'Room', 'Sector', 'FeePerMonth', 'FoodChoice', 'StayFrom', 'Duration', 'Course', 'RegNo',
                  'FirstName', 'MiddleName', 'LastName', 'Gender', 'Contact', 'Email', 'EmerContact', 'GuarName',
                  'GuarRelation', 'GuarContact', 'PerAddress', 'PerCity', 'PerState', 'PerPincode'
                ].map((key, colIndex) => (
                  <td key={colIndex} style={cellStyle}>{item[key] || '—'}</td>
                ))}
              </tr>
            ))}
            {/* Add empty rows if data is less than totalRows */}
            {emptyRows > 0 && (
              Array.from({ length: emptyRows }, (_, index) => (
                <tr key={`empty-row-${index}`} style={{ backgroundColor: '#ffffff' }}>
                  {Array.from({ length: 22 }).map((_, colIndex) => (
                    <td key={colIndex} style={cellStyle}>&nbsp;</td>
                  ))}
                </tr>
              ))
            )}
          </tbody>
        </table>
      ) : (
        !loading && <div>No data available.</div>
      )}
    </div>
  );
};

const searchBarStyle = {
  width: '200px',
  padding: '8px',
  border: '1px solid #ccc',
  borderRadius: '4px',
  fontSize: '16px',
};

const tableStyle = {
  width: '100%',
  borderCollapse: 'collapse',
  tableLayout: 'fixed',
  backgroundColor: '#f3f3f3',
};

const headerStyle = {
  border: '1px solid #ccc',
  padding: '8px',
  backgroundColor: '#007BA7',
  color: '#ffffff',
  fontWeight: 'bold',
  textAlign: 'center',
};

const cellStyle = {
  border: '1px solid #ccc',
  padding: '8px',
  textAlign: 'center',
  color: '#333',
};

export default RegistrationTable;
